"use strict";
const Future = require("fibers/future");
class Queue {
    constructor(items) {
        this.items = items;
        this.items = this.items === undefined ? [] : this.items;
    }
    enqueue(item) {
        this.items.unshift(item);
        if (this.future) {
            this.future.return();
        }
    }
    dequeue() {
        return (() => {
            if (!this.items.length) {
                this.future = new Future();
                this.future.wait();
                this.future = null;
            }
            return this.items.pop();
        }).future()();
    }
}
exports.Queue = Queue;
